  public function badgr_update_badges($accessToken, array $update_badge_details, $badge_entity_id) {
    $updateBadgeContent = $this->httpClient->request(
      'PUT',
      'https://api.badgr.io/v2/badgeclasses/' . $badge_entity_id,
      [
      'headers' => ['Authorization'=> 'Bearer ' . $accessToken],
      'form_params' => $update_badge_details
      ])->getBody()->getContents();
    return $updateBadgeContent;     
  }

